  return (
    <div className="app-container">
        {
          movies.results.map((item) => {
            return (
              <Movie 
                key = {item.id}
                title = {item.title}
                poster = {item.poster}
                grade = {item.grade}
              />
            )
          })
        }
      </div>
  );
}

